import React, { Component } from 'react'

export class ImageCard extends Component {
    render() {

        const { description, urls } = this.props.image;

        return (
            <div>
                <img 
                    alt={description} 
                    src={urls.regular}
                />
            </div>
        )
    }
}

export default ImageCard
